import React from 'react';
import { BrowserRouter, Switch, Route } from 'react-router-dom'
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import Home from './Screens/Home'



function App() {
  return (
    <div className="App">
                <BrowserRouter>
        <Switch>
          <Route exact path="/" component={Home} />


        </Switch>
        </BrowserRouter>
    </div>
  );
}

export default App;
